import React from 'react';
import { FormControl, TextField, FormHelperText, Button,Icon } from "@material-ui/core";

class CommentForm extends React.Component{

    render(){
        return (
          <div>
            <FormControl color="primary" fullWidth="true" className="ml-2 mr-2">
              <TextField
                id="outlined-basic"
                label="Add a comment"
                variant="outlined"
                multiline
                rowsMax={6}
                rows={4}
              />
              <FormHelperText id="my-helper-text">
                We'll never share your personal information.
              </FormHelperText>
              <Button
                variant="contained"
                color="primary"
                endIcon={<Icon>send</Icon>}
              >
                SUBMIT
              </Button>
            </FormControl>
          </div>
        );
    }

}

export default CommentForm;
